import {Form} from "react-bootstrap";

const dateSelectorBlock = {
    justifyContent: 'center',
    marginTop: '40px'
};

const dateSelectorField = {
    width: '20px'
};

function Home() {
    return (
        <Form className="row" style={date_selector_block}>
            <Form className="col-6" style={date_selector_block}>
                <Form.Label>Email address</Form.Label>
                <Form.Control type="dateTime-local" placeholder="Enter email" />
                <Form.Text className="text-muted">
                    We'll never share your email with anyone else.
                </Form.Text>
            </Form>
            <Form className="col-6">
                <Form.Label>Password</Form.Label>
                <Form.Control type="dateTime-local" placeholder="Password" />
            </Form>
        </Form>
    );
}

export default Home;
